namespace Problems

[<RequireQualifiedAccess>]
module The_Millionth_Fibonacci_Kata = 
    open System
    open System.Numerics
    open System.Collections.Generic

    let fibs = Dictionary<int,BigInteger>()
    do
        fibs.Add(0, BigInteger.Zero)
        fibs.Add(1, BigInteger.One)
        fibs.Add(2, BigInteger.One)
        fibs.Add(3, fibs.Item 2 + fibs.Item 1)
        fibs.Add(4, fibs.Item 3 + fibs.Item 2)
        fibs.Add(5, fibs.Item 4 + fibs.Item 3)

    let rec calcFibonacci (n:int) = 
        if fibs.ContainsKey n then fibs.Item n
        else
            let result =
                if (n%2) = 1 then
                    let k = (n+1)/2
                    let fk = BigInteger.Pow(calcFibonacci(k),2)
                    let fkm1 = BigInteger.Pow(calcFibonacci(k-1), 2)
                    fk + fkm1
                else
                    let k = n/2
                    let fk = calcFibonacci(k)
                    let fkm1 = calcFibonacci(k-1)
                    (fkm1 * (fibs.Item 3) + fk) * fk;

            fibs.Add(n, result)|> ignore
            result

    let fib (n:int) =
        match n with
        | 0 -> BigInteger.Zero
        | 1 -> BigInteger.One
        | _ ->
            if n < 0 && n%2 = 0 
                then -(calcFibonacci (Math.Abs(n)))
                else calcFibonacci (Math.Abs(n))

    module Tests = begin
        open Fuchu
        open System.Collections.Generic
    
        let private dict = Dictionary<int, BigInteger>()
        do
            dict.Add(0, BigInteger.Zero)
            dict.Add(1, BigInteger.One)
            dict.Add(2, BigInteger.One)
            dict.Add(3, dict.Item 2 + dict.Item 1)
            dict.Add(4, dict.Item 3 + dict.Item 2)
            dict.Add(5, dict.Item 4 + dict.Item 3)
    
        let rec private calcFibRef (n:int) = 
            if dict.ContainsKey n then dict.Item n
            else
                let result =
                    if (n%2) = 1 then
                        let k = (n+1)/2
                        let fk = BigInteger.Pow(calcFibRef(k),2)
                        let fkm1 = BigInteger.Pow(calcFibRef(k-1), 2)
                        fk + fkm1
                    else
                        let k = n/2
                        let fk = calcFibRef(k)
                        let fkm1 = calcFibRef(k-1)
                        (fkm1 * (dict.Item 3) + fk) * fk;

                dict.Add(n, result)|> ignore
                result
    
        let private fibRef (n:int) =
            if n < 0 && n&&&1=0
                then -(calcFibRef(Math.Abs(n)))
                else calcFibRef(Math.Abs(n))
    
        let suite =
            testList "Solution" [
                testCase "Fibonacci Test" <|
                  fun _ -> 
                      let r = Random()
                      let tests =
                          [ yield r.Next(10000, 100000); yield r.Next(1000000, 1500000)]
                          |> List.append [for _ in 0..10 do yield r.Next(-100, 0) ]
                          |> List.append [0; 1; 2; 3; 4; 5; -6; -96; 1000; 1001;]
    
                      for n in tests do
                          let found = fibRef(n)
                          Assert.Equal("fib " + n.ToString(), fib(n), found)       

                      Assert.Equal("fib -14", fib(-14), -377I)
                      Assert.Equal("fib -21", fib(-21), 10946I)
                      Assert.Equal("fib 500423",fib 1001391, )    
                  ]
    end